Description:
COLPO DI SCENA! VENTURA CONVOCA JORGINHO

Il centrocampista del Napoli chiamato finalmente dal ct che l'aveva dichiaratamente estromesso dalla Nazionale. Nei prossimi giorni Ventura spiegherà il motivo di questa retromarcia.

I CONVOCATI

Portieri: Gianluigi Buffon, Gianluigi Donnarumma, Mattia Perin;

Difensori: Davide Astori, Andrea Barzagli, Leonardo Bonucci, Giorgio Chiellini, Danilo D'Ambrosio, Matteo Darmian, Daniele Rugani, Leonardo Spinazzola, Davide Zappacosta;

Centrocampisti: Federico Bernardeschi, Antonio Candreva, Daniele De Rossi, Stephan El Shaarawy, Alessandro Florenzi, Roberto Gagliardini, Lorenzo Insigne, Jorge Luiz Frello Jorginho, Marco Parolo, Marco Verratti;

Attaccanti: Andrea Belotti, Eder Citadin Martins, Manolo Gabbiadini, Ciro Immobile, Simone Zaza
